import image from '../Success/component.png'


function Success(){

    return(

        <Box>
            <Header/>
            <Box sx={{display:'flex',flexDirection:'column',top: '375px',
                                    left: '506px',
                                    width: '40vw',
                                    height: '60vh'

            ,border:'1px solid red', position:'relative', left:500,top:200}}>
                <Box sx={{width:'100%',height:100}}>
                    <img src={image}/>
